import React, { Component } from 'react';

import BaseLayout from '../components/layouts/BaseLayout';

class CV extends Component {
  render() {
    return (
      <BaseLayout>
        <h1>CV Page!</h1>
      </BaseLayout>
    );
  }
}

export default CV;
